import { Component } from "react";
import { Title, List, Item, Btn } from "./Feedback.styled";

export class Feedback extends Component {
  render() {
    return (
      <>
        <Title>Please leave feedback</Title>
        <List>
          <Item>
            <Btn>Good</Btn>
          </Item>
          <Item>
            <Btn>Neutral</Btn>
          </Item>
          <Item>
            <Btn>Bad</Btn>
          </Item>
        </List>

        <h2>Statistics</h2>
        <ul>
          <li>Good: </li>
          <li>Neutral: </li>
          <li>Bad: </li>
          <li>Total: </li>
          <li>Positive fedback: </li>
        </ul>
      </>
    );
  }
}
